import React from "react";
import ReactDOM from "react-dom";
import { BrowserRouter, Route } from "react-router-dom";
import { Transition, config, animated } from "react-spring";
// import { HashRouter as  Route } from 'react-router-dom';
import App from "./components/App";
import About from "./components/About";
import Work from "./components/Work";
import Contact from "./components/Contact";


ReactDOM.render(
  <BrowserRouter>
    <Route exact path={"/"} component={App} />
    <Route path={"/about"} component={About} />
    <Route path={"/work"} component={Work} />
    <Route path={"/contact"} component={Contact} />
  </BrowserRouter>,
  document.getElementById("root")
);


const Red = ({ style }) => (
  <animated.div className="mainRoute" style={{ ...style, background: `#ef5350` }}>
    <div className="mainRouteItem">
      <p>Red</p>
    </div>
    <Route
      render={({ location }) => (
        <div>
          <Transition
            native
            config={config.slow}
            keys={location.pathname}
            from={{ transform: 'translateY(500px)', opacity: 0 }}
            enter={{ transform: 'translateY(0px)', opacity: 1 }}
            leave={{ transform: 'translateY(500px)', opacity: 0 }}>
          </Transition>
        </div>
      )}
    />
  </animated.div>
)


const Green = ({ style }) => (
  <animated.div className="mainRoute" style={{ ...style, background: `#4CAF50` }}>
    <div className="mainRouteItem">
      <p>Green</p>
    </div>
    <Route
      render={({ location }) => (
        <div>
          <Transition
            native
            config={config.slow}
            keys={location.pathname}
            from={{ transform: 'translateY(500px)', opacity: 0 }}
            enter={{ transform: 'translateY(0px)', opacity: 1 }}
            leave={{ transform: 'translateY(500px)', opacity: 0 }}>
          </Transition>
        </div>
      )}
    />
  </animated.div>
)


ReactDOM.render(<App />, document.getElementById('root'))
